import React from 'react'
import profile from '../blank-profile-picture.png';

const Tweet = () => {
    return (
        <div className="tweet-container">
            <a href="/"><img src={profile}></img></a>
            <h1>Profile Name</h1><br/>
            <p>This is a Tweet.</p>
        </div>
    )
}

export default Tweet
